        #header {
            position: absolute;
            top: 10px;
            left: 50px;
            right: 50px;
            height: 80px;
            padding: 0 20px;
            margin: 0 20px;
            line-height: 80px;
        }
        #header img {
            vertical-align: middle;
            display: inline-block;
            margin-right: 10px;
        }
        button a {
            color: inherit;
            text-decoration: inherit;
        }
        #blank_slate {
            background: rgba(255, 255, 255, 0.9);
