            border-radius: 10px;
            padding: 20px 40px;
            position: absolute;
            top: 110px;
            left: 50px;
            right: 50px;
            bottom: 30px;
            overflow: auto;
        }
        #blank_slate h2 {
            padding: 0 2em 0 0;
            color: #6C9DCF;
        }
        #blank_slate h2 .outof {
            color: #888;
        }
        #blank_slate h3 {
            color: #363636;
        }
        #version {
            position: absolute;
            right: 50px;
            bottom: 5px;
        }
        a {
            color: #6C9DCF;
        }

        table {
            border-collapse: collapse;
            margin: 1em auto;
        }
        th {
            text-align: left;
        }
        td, th {
            border: 1px solid #bbb;
            padding: 5px;
        }
        td.status {
            font-weight: bold;
            text-align: center;
            width: 7em;
        }
        tr.error td.status {
            background-color: #C40C12;
            color: #fff;
        }
        tr.warning td.status {
            background-color: #EF9000;
            color: #FFF;
        }
        tr.ok td.status {
            background-color: #52A500;
            color: #FFF;
        }
        tr.separator td {
            border:none;
        }
        tr.error td.description, tr.warning td.description {
            border-top: none;
        }
        code {
            background-color: #fff;
            border: 1px dashed #bbb;
            display:inline-block;
            padding: 2px;
        }
        p.description {
            font-style: italic;
            font-size: smaller;
        }


        input, button {
            background:#fff;
            -moz-box-shadow:inset 0 2px 2px rgba(143,143,143,0.50);
            -webkit-box-shadow:inset 0 2px 2px rgba(143,143,143,0.50);
            box-shadow:inset 0 2px 2px rgba(143,143,143,0.50);
            padding: 5px;
            -moz-border-radius: 3px;
            -webkit-border-radius: 3px;
            border-radius: 3px;
            border: 1px solid #a8a8a8;
            font-weight: bold;
            font-size: 1.1em;
            color: #4f4f4f;
            text-shadow: 0px 1px 0px rgba(255,255,255,0.7);
        }

        input:focus, input:active {
            border: solid 1px #8ab0c6;
            outline: none;
            -moz-box-shadow:0 0 5px #85b2cb, inset 0 2px 2px #8f8f8f;
            -webkit-box-shadow:0 0 5px #85b2cb, inset 0 2px 2px #8f8f8f;
            box-shadow:0 0 5px #85b2cb, inset 0 2px 2px #8f8f8f;
        }
        input[type=submit], button {
            padding: .4em 1em;
            cursor: pointer;
            color: #313131;
            border: 1px solid #a8a8a8;
            -moz-box-shadow: 0 0 3px #85b2cb;
            -webkit-box-shadow: 0px 0px 3px #85b2cb;
            box-shadow: 0px 0px 3px #85b2cb;
            background: #c4c4c4 linear-gradient(top, rgba(255,255,255,0.8), rgba(255,255,255,0));
            background: #c4c4c4 -webkit-gradient(linear, left top, left bottom, from(rgba(255,255,255,0.8)), to(rgba(255,255,255,0)));
            background: #c4c4c4 -moz-linear-gradient(top, rgba(255,255,255,0.8), rgba(255,255,255,0));
        }
        input[type=submit]:hover, button:hover {
            border: solid 1px #8ab0c6;
            background: #85b2cb linear-gradient(top, rgba(255,255,255,0.6), rgba(255,255,255,0));
            background: #85b2cb -webkit-gradient(linear, left top, left bottom, from(rgba(255,255,255,0.6)), to(rgba(255,255,255,0)));
            background: #85b2cb -moz-linear-gradient(top, rgba(255,255,255,0.6), rgba(255,255,255,0));
        }
        input[type=submit]:active, button:active {
            border: solid 1px #8ab0c6;
            background: #85b2cb linear-gradient(bottom, rgba(255,255,255,0.6), rgba(255,255,255,0));
            background: #85b2cb -webkit-gradient(linear, left bottom, left top, from(rgba(255,255,255,0.6)), to(rgba(255,255,255,0)));
            background: #85b2cb -moz-linear-gradient(bottom, rgba(255,255,255,0.6), rgba(255,255,255,0));
        }

        form label {
            display: inline-block;
            width: 180px;
            font-weight: bold;
            cursor: pointer;
            cursor: hand;
        }

        p.error {
            color: #ff0000;
        }

        #todo li {
            margin-bottom: 0.5em;
        }

        #todo em {
            color: #333;
            font-size: 0.8em;
        }
        #todo em a {
            color: #333;
            text-decoration: none;
        }
        #todo em a:hover {
            text-decoration: underline;
        }

        #languages {
            margin: 0 0 1em;
        }
        .languages_tip {
            font-style: italic;
        }
        #languages li {
            list-style-type: none;
            display: block;
            line-height: 24px;
            cursor: move;
            font-size: 1.1em;
        }
        #languages label {
            padding: 3px;
            cursor: pointer;
            cursor: hand;
            display: inline;
            font-weight: normal;
        }
        #languages li.checked label {
            font-weight: bold;
        }
        #languages input {
            padding: 2px;
            font-size: 1em;
        }
        #languages span.error {
            font-weight: normal;
            color: #ff0000;
        }
    </style>
</head>

